import '../App.css';
import Bats from '../components/Bats';
import Cheetah from '../components/Cheetah';
import Bears2 from '../components/Bears2';
import Bears from '../components/Bears';
import Bears3 from '../components/Bears3';
import Bears4 from '../components/Bears4';
import Animals from '../components/Animals';
import Buffalo from '../components/Buffalo';
import Camels from '../components/Camels';
import Cats from '../components/Cats';
import Chips from '../components/Chips';
import Cows from '../components/Cows';
import Doggo from '../components/Doggo';
import Elephant from '../components/Elephant';
import Giraffe from '../components/Giraffe';
import Gorillaz from '../components/Gorillaz';
import Gorillaz2 from '../components/Gorillaz2';
import Gorillaz3 from '../components/Gorillaz3';
import Hippos from '../components/Hippos';
import Horses from '../components/Horses';
import Lemurs from '../components/Lemurs';
import Lionness from '../components/Lionness';
import Lionness2 from '../components/Lionness2';
import Lontra from '../components/Lontra';
import Monkeys from '../components/Monkeys';
import Owls from '../components/Owls';
import Owls2 from '../components/Owls2';
import Pandas from '../components/Pandas';
import Penguins from '../components/Penguins';
import PolarBear from '../components/PolarBear';
import Squirrels from '../components/Squirrels';
import Swans from '../components/Swans';
import Tartoise from '../components/Tartoise';
import WildDoggo from '../components/WildDoggo';

const App = () => {
  return (
    <div className="container">
        <div class="header">
          <h1>Kaori & Nader</h1>
        </div>
        <div id="gallery">
          <Animals />
          <Bats />
          <Cheetah />
          <Bears />
          <Bears2 />
          <Bears3 />
          <Bears4 />
          <Buffalo />
          <Camels />
          <Cats />
          <Chips />
          <Cows />
          <Doggo />
          <Elephant />
          <Giraffe />
          <Gorillaz />
          <Gorillaz2 />
          <Gorillaz3/>
          <Hippos />
          <Horses />
          <Lemurs />
          <Lionness />
          <Lionness2 />
          <Lontra />
          <Monkeys />
          <Owls />
          <Owls2 />
          <Pandas/>
          <Penguins />
          <PolarBear />
          <Squirrels />
          <Swans />
          <Tartoise />
          <WildDoggo />
        </div>
    </div>
  )
}

export default App;
